dict.string:
query="$1"

log() {
  echo "$@" >&2
}

fatal() {
  echo -n "$@"
  log "$@"
  exit 1
}

log "."
log "/---------- NEW ----------\\"
log "engine=$engine"
log "variant=$variant"
log "name=$name"
# log "query=$query"

opts=(add)

test -n "$engine" && { opts+=(--engine "$engine") } || { fatal "engine unset" }
test -n "$variant" && { opts+=(--variant "$variant") }  || { fatal "variant unset" }
test -n "$name" && { opts+=("$name") } || { fatal "name unset" }
# test -n "$query" && { opts+=("$query") } || { fatal "query unset" }

output="$( ./searchio $opts 2>&1 )"
ok=$?

[[ $ok -ne 0 ]] && {
  log "$output"
  echo -n "$output"
} || {
  echo -n "$name"
}

log "\\---------- NEW ----------/"

exit $ok
